import React from 'react';
import Paper from '@material-ui/core/Paper';
import { Typography } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles((theme) => ({
    root: {
      display: 'flex',
      flexWrap: 'wrap',
      '& > *': {
        margin: theme.spacing(1),
        width: theme.spacing(16),
        height: theme.spacing(16),
      },
    },
  }));


function WeatherType({ min,max,min1,max1,min2,max2,min3,max3,min4,max4,min5,max5,min6,max6,
    icon,icon1,icon2,icon3,icon4,icon5,icon6}) {
        const classes = useStyles();
    return (
        <>
        <p>{min}&deg;C/{max}&deg;C</p>
        <p>{min1}&deg;C/{max1}&deg;C</p>
        <p>{min2}&deg;C/{max2}&deg;C</p>
        <p>{min3}&deg;C/{max3}&deg;C</p>
        <p>{min4}&deg;C/{max4}&deg;C</p>
        <p>{min5}&deg;C/{max5}&deg;C</p>
        <p>{min6}&deg;C/{max6}&deg;C</p>

        <img src={`https://openweathermap.org/img/w/${icon}.png`} alt="pic"/>
        <img src={`https://openweathermap.org/img/w/${icon1}.png`} alt="pic"/>
        <img src={`https://openweathermap.org/img/w/${icon2}.png`} alt="pic"/>
        <img src={`https://openweathermap.org/img/w/${icon3}.png`} alt="pic"/>
        <img src={`https://openweathermap.org/img/w/${icon4}.png`} alt="pic"/>
        <img src={`https://openweathermap.org/img/w/${icon5}.png`} alt="pic"/>
        <img src={`https://openweathermap.org/img/w/${icon6}.png`} alt="pic"/>

        <Paper className={classes.root} elevation={3}>
        <Typography>Hello World</Typography>
        </Paper>
        </>
    )
}

export default WeatherType
